//var hardCodedManifestData = '{ "@context": "http://iiif.io/api/presentation/2/context.json", "@id": "http://www.e-codices.unifr.ch/metadata/iiif/aaa/manifest.json", "@type": "sc:Manifest", "label": "Trois Canvases de la Manifest", "metadata": [ { "label": "Location", "value": "Beromünster" }, { "label": "Date", "value": [ { "@value": "erste Hälfte des 11. Jahrhunderts", "@language": "de" }, { "@value": "first half of the 11th century", "@language": "en" }, { "@value": "première moitié du XIe siècle", "@language": "fr" }, { "@value": "prima metà del sec. XI", "@language": "it" } ] } ], "description": [ { "@value": "Das Epistolar ist die älteste Handschrift der Bibliothek des Stifts Beromünster und laut „Haustradition“ wurde es von einem Mitglied der Stifterfamilie von Lenzburg, dem Grafen Ulrich († vor 1050), geschenkt. Der Vorderdeckel besteht aus einer später hinzugefügten Elfenbeintafel der 2. Hälfte-Ende des 13. Jhs.", "@language": "de" }, { "@value": "The Epistolary is the oldest manuscript in the library at Beromunster; according to local tradition it was presented by a member of the patron family of Lenzburg, Count Ulrich († before 1050). The front cover, added later, is an ivory panel dating from the second half of, perhaps the end of, the 13th century.", "@language": "en" }, { "@value": "L’épistolaire est le plus ancien manuscrit du chapitre collégial de Beromünster et fut, selon la tradition, offert par un membre de la famille du fondateur de Lenzbourg, le comte Ulrich († avant 1050). Le plat antérieur se compose d’une tablette d’ivoire de la seconde moitié ou de la fin du XIIIe s. ajoutée plus tard.", "@language": "fr" }, { "@value": "L’Epistolario è il più antico manoscritto conservato dalla biblioteca di Beromünster e, secondo la tradizione locale, venne donato da un membro della famiglia dei fondatori von Lenzburg, il conte Ulrico († prima del 1050). La coperta anteriore è costituita da un tavola di avorio della seconda metà-fine del sec. XIII, aggiunta in un secondo tempo.", "@language": "it" } ], "license": "http://creativecommons.org/licenses/by-nc/4.0/", "attribution": "e-codices - Virtual Manuscript Library of Switzerland", "service": [ { "@context": "https://www.w3.org/TR/webmention/", "@id": "http://www.e-codices.unifr.ch/webmention/receive", "profile": "http://w3.org/TR/webmention", "label": "e-codices Webmention Service" } ], "see_also": "http://www.e-codices.unifr.ch/en/list/one/sbb/epist", "within": "http://www.e-codices.unifr.ch/en/list/sbb", "sequences": [ { "@id": "http://www.e-codices.unifr.ch/metadata/iiif/sbb-epist/sequence/Sequence-960.json", "@type": "sc:Sequence", "label": [ { "@value": "Standardabfolge", "@language": "de" }, { "@value": "Normal Sequence", "@language": "en" }, { "@value": "Séquence normale", "@language": "fr" }, { "@value": "Sequenza normale", "@language": "it" } ], "canvases": [ { "@id": "http://www.e-codices.unifr.ch/metadata/iiif/sbb-epist/canvas/sbb-epist_e001.json", "@type": "sc:Canvas", "label": "bindingA", "height": 6496, "width": 4872, "images": [ { "@id": "http://www.e-codices.unifr.ch/metadata/iiif/sbb-epist/annotation/sbb-epist_e001.json", "@type": "oa:Annotation", "motivation": "sc:painting", "on": "http://www.e-codices.unifr.ch/metadata/iiif/sbb-epist/canvas/sbb-epist_e001.json", "resource": { "@id": "http://www.e-codices.unifr.ch/loris/sbb/sbb-epist/sbb-epist_e001.jp2/full/full/0/default.jpg", "@type": "dctypes:Image", "format": "image/jpeg", "height": 6496, "width": 4872, "service": { "@context": "http://iiif.io/api/image/2/context.json", "@id": "http://www.e-codices.unifr.ch/loris/sbb/sbb-epist/sbb-epist_e001.jp2", "profile": "http://iiif.io/api/image/2/level2.json" } } } ] }, { "@id": "http://www.e-codices.unifr.ch/metadata/iiif/sbb-epist/canvas/sbb-epist_e001.json", "@type": "sc:Canvas", "label": "bindingA", "height": 6496, "width": 4872, "images": [ { "@id": "http://www.e-codices.unifr.ch/metadata/iiif/sbb-epist/annotation/sbb-epist_e001.json", "@type": "oa